import React from "react";

const Navbar = () => {
    return (
        <nav class="container bg-gray-800 border-gray-200 px-2 py-2.5 rounded">
            <ul class="flex my-4 flex-row text-sm font-medium">
                <li>
                    <a
                        href="#"
                        className="text-white bg-transparent text-blue-700 "
                    >
                        Shop
                    </a>
                </li>
                <li>
                    <a href="#" className="text-white bg-transparent">
                        Cart
                    </a>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
